    amountFormat:function(v) {
        if(!v) return '0.00'
            v = parseFloat(v).toFixed(2);
        v = v.toString().split('.');
        return (+v[0]).toLocaleString() + '.' + (v[1] >= 01 ? v[1] : '00');
    },
